        Vue.component("v-1d7976f0c224b", comp.default)
        next()
      })
    }
  },
  {
    path: "/A320FM/index.html",
    redirect: "/A320FM/"
  },
  {
    name: "v-09dedbede64bf",
    path: "/A330/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("C:\\Users\\wind\\Desktop\\330wuyanzu.github.io-AC\\docs\\A330\\README.md").then(comp => {
        Vue.component("v-09dedbede64bf", comp.default)
        next()
      })
    }
  },
  {
    path: "/A330/index.html",
    redirect: "/A330/"
  },
  {
    name: "v-f705a9dccccd2",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("C:\\Users\\wind\\Desktop\\330wuyanzu.github.io-AC\\docs\\README.md").then(comp => {
        Vue.component("v-f705a9dccccd2", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
